import React from 'react';
import Header from './Header.jsx';
import Footer from './Footer.jsx';
import Note from './Note.jsx';
import notes from '../notes'; 



function App() {
    return <div>
        <Header />
        notes.map(function (element)(
            return <Note 
                key={element.id}
                title={element.title}
                content={element.name}
            /> 
        ))
        <Footer /> 
    </div>
}

export default App;
